import React from 'react';
import { cars } from './car_stock';
import CarCard from './carcrad';

const Main = () => {
  // Вибираємо перші 10 автомобілів для відображення на головній сторінці
  const featuredCars = cars.slice(0, 10);

  return (
    <main>
      <h1 className="section-title">Our Cars</h1>
      <div id="car-grid">
        {featuredCars.map((car, index) => (
          <CarCard key={index} car={car} />
        ))}
      </div>
    </main>
  );
};

export default Main;
